  false,\n\t\"url\": null,\n\t\"notes\": \"This report describes the history and general
  description, biological characteristics, recreational use, acquisition and development
  potential, proposed development and management, and acquisition recommendations
  for Franklin Lake. It is recommended part of Franklin Lake be added to the Ruby
  Lake Rational Wildlife Refuge. It has by far the best refuge potential of any area
  existing in eastern Nevada and with only limited development can probably surpass
  the existing Ruby Lake NWR in value to the waterfowl resource of the Pacific Flyway.
  The addition would benefit the rare and endangered species program by providing
  habitat for trumpeter swans and greater sandhill cranes. Development to take full
  advantage of available water is expected to increase waterfowl production (particularly
  mallards} pintails, gadwall, cinnamon-blue-winged teal, and redheads) and waterfowl
  migrational use* Increased public use in the forms of nature study, waterfowl hunting
  sari sightseeing will come as a result of improved access and increased wildlife
  populations. A tentative acquisition proposal, subject to change as a result of
  realty and engineering feasibility studies, is for a 14,000-acre refuge addition
  including the Raymond Gardiner and Walter Gardiner Ranches (including the lake lands
  claimed by them) and sufficient public domain land on the east side of Rranklin
  lake to create a manageable water area. Water and marsh within this area would total
  about 5,000 acres. These limits may need to be expanded to the north to secure additional
  water rights or to protect private landowners and the Government from possible water
  surpluses.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
